import React from "react";
import { View, Text, StyleSheet } from "react-native";
import { Button } from "../components/Button";

export function HomeScreen({ navigation }) {
    return (
        <View style={styles.container}>
            <Text>Tela Inicial</Text>
            <Button text="Ir para a tela de detalhes" onPress={() => navigation.navigate("Details")} />
            <Button text="Ir para a home" onPress={() => navigation.navigate("Home")} />
            <Button text="Voltar" onPress={() => navigation.goBack()} />
            <Button text="Voltar para a primeira tela " onPress={() => navigation.goBack()} />
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#ddd',
        alignItems: 'center',
        justifyContent: 'center',
    },    
});
